지금의 우리는 미디어의 홍수 속에서 살아가고 있습니다. 어느 장소 어느 곳을 보아도 사람들의 시선은 핸드폰에 고정되어 있고, 고개를 들어도 수많은 영상들과 소음들로 가득합니다. 이렇게 언제 어디서든 수없이 쏟아지는 정보들은 우리를 쉴 수도, 생각할 수도, 어딘가를 가만히 바라보기도 힘들게 만들고 우리를 병들게 합니다.

프로젝트 ‘너의 눈으로 나를 본다’는 ‘관계‘를 주제로 제작된 사운드 디자인과 모션그래픽 영상이 무대 위에 상영되고, 관객과 연주자가 무대 위 같은 곳을 바라보며 진행되는 공연입니다. 연주자는 상영되는 영상과 사운드위에 즉흥 연주를 더해 ’관계‘에 대한 해석을 제시하고, 관객은 연주자와 같은 시선으로 영상, 사운드, 연주의 해석을 공유하며, 공연 시간동안 연주자와 관객이 서로 같은 곳을 바라보며 감정을 공유하는 경험을 하게 됩니다. 이 경험은 관객들에게 자기 자신의 감정을 다시 한 번 바라보고, ’관계’에 대한 의미에 대해 고민해 볼 수 있는 계기가 될 것입니다.

프로젝트의 공연은 모두 무료공연으로 이루어질 예정으로 ‘관계’에 대한 고민을 가진 누구나 관람할 수 있습니다.

